// OnConflict allows configuring the `ON CONFLICT` / `ON DUPLICATE KEY` clause
// of the `INSERT` statement. For example:
//
//	client.PreimageRequest.CreateBulk(builders...).
//		OnConflict(
//			// Update the row with the new values
//			// the was proposed for insertion.
//			sql.ResolveWithNewValues(),
//		).
//		// Override some of the fields with custom
//		// update values.
//		Update(func(u *ent.PreimageRequestUpsert) {
//			SetCreateTime(v+v).
//		}).
//		Exec(ctx)
func (prcb *PreimageRequestCreateBulk) OnConflict(opts ...sql.ConflictOption) *PreimageRequestUpsertBulk {
	prcb.conflict = opts
	return &PreimageRequestUpsertBulk{
		create: prcb,
	}
}

// OnConflictColumns calls `OnConflict` and configures the columns
// as conflict target. Using this option is equivalent to using:
//
//	client.PreimageRequest.Create().
//		OnConflict(sql.ConflictColumns(columns...)).
//		Exec(ctx)
func (prcb *PreimageRequestCreateBulk) OnConflictColumns(columns ...string) *PreimageRequestUpsertBulk {
	prcb.conflict = append(prcb.conflict, sql.ConflictColumns(columns...))
	return &PreimageRequestUpsertBulk{
		create: prcb,
	}
}

// PreimageRequestUpsertBulk is the builder for "upsert"-ing
// a bulk of PreimageRequest nodes.
type PreimageRequestUpsertBulk struct {
	create *PreimageRequestCreateBulk
}

// UpdateNewValues updates the mutable fields using the new values that
// were set on create. Using this option is equivalent to using:
//
//	client.PreimageRequest.Create().
//		OnConflict(
//			sql.ResolveWithNewValues(),
//			sql.ResolveWith(func(u *sql.UpdateSet) {
//				u.SetIgnore(preimagerequest.FieldID)
//			}),
//		).
//		Exec(ctx)
func (u *PreimageRequestUpsertBulk) UpdateNewValues() *PreimageRequestUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWithNewValues())
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(s *sql.UpdateSet) {
		for _, b := range u.create.builders {
			if _, exists := b.mutation.ID(); exists {
				s.SetIgnore(preimagerequest.FieldID)
			}
			if _, exists := b.mutation.CreateTime(); exists {
				s.SetIgnore(preimagerequest.FieldCreateTime)
			}
		}
	}))
	return u
}

// Ignore sets each column to itself in case of conflict.
// Using this option is equivalent to using:
//
//	client.PreimageRequest.Create().
//		OnConflict(sql.ResolveWithIgnore()).
//		Exec(ctx)
func (u *PreimageRequestUpsertBulk) Ignore() *PreimageRequestUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWithIgnore())
	return u
}

// DoNothing configures the conflict_action to `DO NOTHING`.
// Supported only by SQLite and PostgreSQL.
func (u *PreimageRequestUpsertBulk) DoNothing() *PreimageRequestUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.DoNothing())
	return u
}

// Update allows overriding fields `UPDATE` values. See the PreimageRequestCreateBulk.OnConflict
// documentation for more info.
func (u *PreimageRequestUpsertBulk) Update(set func(*PreimageRequestUpsert)) *PreimageRequestUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(update *sql.UpdateSet) {
		set(&PreimageRequestUpsert{UpdateSet: update})
	}))
	return u
}

